import './Footer.css';
export default function Footer() {
  return (
    <div>
      <footer>
  <div class="copyright">
    <p>&copy Made by Anant Shah</p>
  </div>
  <div class="social">
    <a href="#" class="support">Contact Us</a>
    <a href="#" class="face">Feedback</a>
    <a href="#" class="tweet">t</a>
